import React from "react";

function Skills() {
  function skillBox(skill, img) {
    return (
      <div className="skillBox">
        <img src={img} alt={skill} />
        <p>{skill}</p>
      </div>
    );
  }
  return (
    <div className="skills">
      <h1>Skills</h1>
      <div className="skillBoxContainer">
        {skillBox("HTML5", "fab fa-html5")}
      </div>
    </div>
  );
}

export default Skills;
